import React from 'react';
import { useLocation } from 'react-router-dom';

const Scorepage = () => {
    const location = useLocation();
    const { score } = location.state; // Extract state from location

    let message;
    if (score >= 8 && score <= 10) {
        message = "Very good!";
    } else if (score >= 5 && score < 8) {
        message = "Good!";
    } else {
        message = "Better luck next time!";
    }

    return (
        <div style={{ background: 'blue', height: '600px', width: '60%', marginTop: '150px', marginLeft: '500px' }}>
            <h1 className='text-7xl' style={{ textAlign: 'center' }}>Result</h1>
            <h1 className='text-8xl pt-24' style={{ textAlign: 'center' }}>{score} of</h1>
            
            <h2 className='text-4xl' style={{ textAlign: 'center' }}>{message}</h2>
        </div>
    );
};

export default Scorepage;
